SET @importFile = :importFile;SELECT     STR_TO_DATE(@importFile,'%Y-%m-%d')INTO    @importDateFROM DUAL;USE `GeorgiaVoterData`;CREATE TABLE IF NOT EXISTS `Histories` (    `County Code` char(3) NOT NULL DEFAULT '',    `Voter ID` varchar(14) NOT NULL DEFAULT '',    `Old Registration Number` varchar(14) NOT NULL DEFAULT '',    `Election Date` date NOT NULL DEFAULT '0000-00-00',    `Election Type Code` char(3) NOT NULL DEFAULT '',    `Party` char(1) DEFAULT NULL,    `Absentee` char(1) DEFAULT NULL,    `Export Date` date NOT NULL DEFAULT '0000-00-00') ENGINE=InnoDB DEFAULT CHARSET=utf8;DELETE FROM `Histories` WHERE `Export Date`=@importDate;CREATE TEMPORARY TABLE countyTemp LIKE `Histories`;LOAD DATA LOCAL INFILE '/tmp/vparseImport.txt'    INTO TABLE countyTemp    LINES TERMINATED BY '\r\n'    (@record)SET `Export Date` = STR_TO_DATE('0000-00-00','%Y%m%d'),    `County Code` = SUBSTR(@record,0,3),    `Voter ID` = SUBSTR(@record,3,14),    `Old Registration Number` = SUBSTR(@record,11,14),    `Election Date` = STR_TO_DATE(SUBSTR(@record,25,8),'%m/%d/%Y'),    `Election Type Code` = SUBSTR(@record,33,3),    `Party` = SUBSTR(@record,36,1),    `Absentee` = SUBSTR(@record,37,1);UPDATE countyTemp SET `Export Date` = @importDate;INSERT INTO `Histories` SELECT * FROM countyTemp;CALL `GeorgiaVoterCodes`.`buildCountyHistories`(@importDate);